import React from 'react';

class Form extends React.Component{
    render(){
        return(
            <div>
                <form>
                    <div className="elemento-form">
                        <label>Id incidencia:</label>
                        <input type="number" name="id" placeholder="Introduce el id de la incidencia" required></input>
                    </div>
                    <div className="elemento-form">
                        <label>Titulo incidencia:</label>
                        <input type="text" name="titulo" placeholder="Introduce el titulo de la incidencia" required></input>
                    </div>
                </form>
            </div>    
        
        )
    }
}

export default Form;
